<?xml version="1.0" encoding="UTF-8"?>
<html xmlns="http://www.w3.org/1999/xhtml" xmlns:wicket="http://wicket.apache.org/dtds.data/wicket-xhtml1.4-strict.dtd">
<body>
<wicket:panel>
    <div class="jump">
        <div class="label">
            <div class="header">
                <wicket:message key="jump"></wicket:message>
            </div>
            <div wicket:id="list">
                <wicket:container wicket:id="jumpList">
                    <div wicket:id="jumpInfoPanel"></div>
                </wicket:container>
            </div>
        </div>
        <a wicket:id="addJump">
            <wicket:message key="addJump"></wicket:message>
        </a>
    </div>
    <div wicket:id="editDialog"></div>
</wicket:panel>
</body>
</html>
